import React from 'react';
import './App.css';

function App() {
  return (
    <div class="container is-fluid">
      <div class="notification">
        This container is <strong>fluid</strong>: it will have a 32px gap on either side, on any
        viewport size.
      </div>
    </div>
  )}

export default App;
